import React,{useEffect, useState} from "react";

const App =()=>{

    const [num,setnum]=new useState(0);

    useEffect(()=>{
        alert("Hi");
        document.title=`You Clicked Me ${num} times`
    })


    return(
     <button onClick={()=>{
         setnum(num+1);
     }}>Click Me {num}</button>
    )
    
};
export default App;
